import './Table.css';

function Table({data}) {
    const renderTableData = (object) => {
        return object.data.map((data,index ) => {
            console.log(index)
            return  <td key={index}>{data}</td>;
        });
    }
    return (
        <>
            <table id="Info">
                <thead>
                    <tr>
                        <th>First Name</th>
                        <th>Last Name</th>
                    </tr>
                </thead>
                <tbody>
                    { data &&   
                        data.map(value => {
                            return <tr>{renderTableData(value)}</tr>;
                        })
                    }
                </tbody>
            </table>
        </>
    )
}
export default Table;
